msg.payload.forEach(function(telemetry) {
    if (telemetry.key === "ip") msg.host = telemetry.value
    if (telemetry.key === "port") msg.port = telemetry.value
    if (telemetry.key === "meterSerial") msg.serial = telemetry.value 
    if (telemetry.key === "key") msg.key = telemetry.value 

});

return msg;

let dataString = msg.payload;
let dataArray = dataString.split("\n")

//msg.payload = dataArray


let array = dataArray

msg.regData = {}

msg.regData["rawData"] = msg.payload
//msg.regData["Model"] = array

array.forEach(function (reg) {

    let dataPair = reg.split("(")
    if (dataPair.length > 1) {
        let key = dataPair[0]
        let value1 = dataPair[1].replace(")", "").split("*")[0]
        let unit1 = dataPair[1].replace(")", "").split("*")[1]
        let value2 = dataPair[2] ? dataPair[2].replace(")", "") : dataPair[2]
        msg.regData[key + "_value1"] = value1
        msg.regData[key + "_unit1"] = unit1
        msg.regData[key + "_value2"] = value2
    }

});

return msg;

